    0% {
        opacity: 0;
    }
    100% {
        opacity: 1;
     }
}

@keyframes spinIn {
    0% {
        opacity: 0;
        color: #1699FE;
        transform: rotate(90deg);
        font-size: 100px;
    }
    100% {
        opacity: 1;
        transform: rotate(0deg);
     }
}

@keyframes sizeIn {
    0% {
